  \"2013-03-15T22:27:32.249373\",\n\t\"name\": \"oklahoma-well-log-oberservations\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data contain basic information describing
  well logs and compiled by the Oklahoma Geological Survey, published as a downloadable
  file, ESRI Service, and as a Web Feature service for the National Geothermal Data
  System. The downloadable documents contain 9 worksheets, including information about
  the template, notes related to revisions of the template, resource provider information,
  the data, a field list (data mapping view) and a worksheet with vocabularies for
  use in populating the spreadsheet (data valid terms). Fields in the data table include
  Well Name, API Number, Ended Drilling Date, Well Type, Bottom Logged Interval,and
  Log Notes. \",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
